list<int>E[5000], out;
bool V[5000];
int indeg[5000];

void tsort(int s) {
	priority_queue<int, vector<int>, greater<int>>que;
	que.push(s);
	V[s] = true;
	while (!que.empty()) {
		int u = que.top(); que.pop();
		out.push_back(u);
		for (int v : E[u]) {
			indeg[v]--;
			if (!indeg[v] && !V[v]) {
				V[v] = true;
				que.push(v);
			}
		}
	}
}


